import React, { Component } from "react";
import "./Footer.css";
class Footer extends Component {
  render() {
    return (
      <div className="Footer">
        {/* Footer */}
        <footer className="page-footer font-small cyan darken-3">
          {/* Footer Elements */}
          <div className="container">
            {/* Grid row*/}
            <div className="row">
              {/* Grid column */}
              <div className="col-md-12 py-5">
                <div className="mb-5 flex-center">
                  {/* Facebook */}
                  <a className="fb-ic">
                    <i className="fab fa-facebook-f fa-lg blue-text mr-md-5 mr-3 fa-4x">
                      {" "}
                    </i>
                  </a>
                  {/* Twitter */}
                  <a className="tw-ic">
                    <i className="fab fa-twitter fa-lg blue-text mr-md-5 mr-3 fa-4x">
                      {" "}
                    </i>
                  </a>
                  {/* Google +*/}
                  <a className="gplus-ic">
                    <i className="fab fa-google-plus-g fa-lg red-text mr-md-5 mr-3 fa-4x">
                      {" "}
                    </i>
                  </a>
                  {/*Linkedin */}
                  <a className="li-ic">
                    <i className="fab fa-linkedin-in fa-lg blue-text mr-md-5 mr-3 fa-4x">
                      {" "}
                    </i>
                  </a>
                  {/*Instagram*/}
                  <a className="ins-ic">
                    <i className="fab fa-instagram fa-lg red-text mr-md-5 mr-3 fa-4x">
                      {" "}
                    </i>
                  </a>
                  {/*Pinterest*/}
                  <a className="pin-ic">
                    <i className="fab fa-pinterest fa-lg white-text fa-4x"> </i>
                  </a>
                </div>
              </div>
              {/* Grid column */}
            </div>
            {/* Grid row*/}
          </div>
          {/* Footer Elements */}
          {/* Copyright */}
          <div className="footer-copyright text-center py-3">
            Â© 2018 Copyright:
            <a href="https://mdbootstrap.com/education/bootstrap/">
              {" "}
              MDBootstrap.com
            </a>
          </div>
          {/* Copyright */}
        </footer>
        {/* Footer */}
      </div>
    );
  }
}

export default Footer;
